		function playAll() {
		    if (currentInstance) {
		        currentInstance.paused = false;
		    } else {
		        playSound(currentSoundIndex);
		    }
		}
		
		function pause() {
		    if (currentInstance) {
		        currentInstance.paused = true;
		    }
		}
		
		function next() {
		    currentSoundIndex = (currentSoundIndex + 1) % sounds.length;
		    playSound(currentSoundIndex);
		}
		
		function prev() {
		    currentSoundIndex = (currentSoundIndex - 1 + sounds.length) % sounds.length;
		    playSound(currentSoundIndex);
		}
		
		function toggleLoopit2x() {
		    loopit2x = !loopit2x;
		    if (loopit2x) {
		        loopCount = 2;
		        loopit3x = false;
		        noloop = false;
		    } else {
		        loopCount = 1;
		        noloop = true;
		    }
		}
		
		function toggleLoopit3x() {
		    loopit3x = !loopit3x;
		    if (loopit3x) {
		        loopCount = 3;
		        loopit2x = false;
		        noloop = false;
		    } else {
		        loopCount = 1;
		        noloop = true;
		    }
		}
		
		function toggleNoloop() {
		    noloop = !noloop;
		    if (noloop) {
		        loopCount = 1;
		        loopit2x = false;
		        loopit3x = false;
		    }
		}
		
		function togglePlayContinously() {
		    playcontinously = !playcontinously;
		    if (playcontinously) {
		        playtheline = false;
		    }
		}
		
		function togglePlayTheLine() {
		    playtheline = !playtheline;
		    if (playtheline) {
		        playcontinously = false;
		    }
		}
		
		function playSound(index) {
		    if (isPlaying) {
		        createjs.Sound.stop();
		    }
		    isPlaying = true;
		    currentSoundIndex = index;
		    currentInstance = createjs.Sound.play(sounds[currentSoundIndex]);
		    currentInstance.on("complete", handleComplete, this, false, {count: 1});
		}
		
		function handleComplete(event, data) {
		    var count = data.count;
		
			//if playtheline it loops using count then when it finishes looping isPlaying=true(meaning pause
			//because)
			
		if (playtheline && count < loopCount) { 
		setTimeout(function() { 
		playSound(currentSoundIndex); 
		currentInstance.on("complete", handleComplete, this, false, {count: count + 1}); 
		}, 1000); 
		} else { 
		isPlaying = true; 
		} 
		
		if (count < loopCount) { 
		setTimeout(function() { 
		playSound(currentSoundIndex); 
		currentInstance.on("complete", handleComplete, this, false, {count: count + 1}); 
		}, 1000); 
		} else { 
		isPlaying = false; 
		setTimeout(function() { 
		currentSoundIndex = (currentSoundIndex + 1) % sounds.length; 
		if (!playtheline) { 
		playSound(currentSoundIndex); 
		} else { 
		pause(); 
		} 
		}, 1000); 
		} 
		}
